// a function that takes a string as input and returns the number of unique integers in it
const f_gold = (word) => {
    // split the string into an array of numbers
    let nums = word.split(/[a-z]+/);
    // return the number of unique integers in the array
    return new Set(nums.filter(num => num != '').map(num => parseInt(num))).size;
}
